<style>
    :root {
      --bg: #f1f5f9;
      --card-bg: #ffffff;
      --text: #0f172a;
      --muted: #6b7280;
      --ring: #e5e7eb;
      --brand: #2563eb;
      --radius: 16px;
    }
    * { box-sizing: border-box; }
    /* body {
      margin: 0;
      font-family: system-ui, -apple-system, "Segoe UI", Roboto, Noto Sans, "Helvetica Neue", Arial, "Apple Color Emoji", "Segoe UI Emoji";
      background: var(--bg);
      color: var(--text);
      -webkit-font-smoothing: antialiased;
      line-height: 1.5;
    } */

    /* Page shell */
    /* .wrap {
      max-width: 860px;
      margin: 24px auto;
      padding: 0 16px;
    } */
    /* .header {
      display: flex; align-items: center; justify-content: space-between;
      margin-bottom: 14px; 
    } */
    .title {
      font-weight: 700; letter-spacing: .2px;
    }
    .sub {
      color: var(--muted); font-size: .92rem;
    }

    /* Scrollable feed container */
    .feed {
      background: linear-gradient(#ffffff, #ffffff) padding-box,
                 linear-gradient(180deg, #e2e8f0, #f8fafc) border-box;
      border: 1px solid transparent;
      border-radius: var(--radius);
      box-shadow: 0 8px 26px rgba(2, 6, 23, 0.05);
      padding: 12px;
      height: min(78vh, 780px);   /* controls scroll height */
      overflow-y: auto;
    }
    .feed::-webkit-scrollbar { width: 10px; }
    .feed::-webkit-scrollbar-thumb {
      background: #cbd5e1;
      border-radius: 999px;
    }
    .feed::-webkit-scrollbar-thumb:hover { background: #94a3b8; }

    /* Card */
    .card {
      background: var(--card-bg);
      border: 1px solid var(--ring);
      border-radius: calc(var(--radius) - 4px);
      overflow: hidden;
      margin: 10px;
      box-shadow: 0 1px 0 rgba(2, 6, 23, 0.03);
    }
    .card-head {
      display: grid; grid-template-columns: auto 1fr auto;
      gap: 12px; align-items: center;
      padding: 14px 14px 10px;
    }
    .logo {
      width: 42px; height: 42px; border-radius: 999px;
      display: grid; place-items: center;
      background: radial-gradient(circle at 40% 30%, #1e293b, #0f172a);
      color: white; font-weight: 800; font-size: .9rem;
      border: 1px solid #e2e8f0;
      overflow: hidden;
    }
    .logo img { width: 100%; height: 100%; object-fit: cover; border-radius: 999px; }
    .meta small { color: var(--muted); }
    .share {
      border: 1px solid var(--ring); background: #fff; color: #334155;
      padding: 6px 10px; border-radius: 999px; font-size: .85rem; cursor: pointer;
    }
    .share:hover { background: #f8fafc; }

    .media {
      width: 100%;
      aspect-ratio: 16 / 12;
      background: linear-gradient(135deg, #e2e8f0, #f1f5f9);
      border-top: 1px solid var(--ring);
      border-bottom: 1px solid var(--ring);
      display: block;
      object-fit: cover;
    }

    .content { padding: 12px 14px 8px; font-size: 1rem; }
    .tags { color: #334155; font-size: .95rem; }
    .tags a { color: var(--brand); text-decoration: none; }
    .tags a:hover { text-decoration: underline; }

    .card-foot {
      display: flex; align-items: center; justify-content: space-between;
      padding: 10px 14px 14px; color: var(--muted); font-size: .92rem;
      border-top: 1px solid var(--ring);
    }
    .link-btn {
      color: var(--brand); border: 1px solid rgba(37, 99, 235, 0.25);
      padding: 6px 10px; border-radius: 10px; text-decoration: none; font-weight: 600;
      background: linear-gradient(#fff, #fff) padding-box, 
                  radial-gradient(circle at 10% -20%, #e0e7ff, #eff6ff) border-box;
    }
    .link-btn:hover { background: #f8fafc; }

    /* Responsive */
    @media (max-width: 560px) {
      .card { margin: 8px 4px; }
      .content { font-size: .98rem; }
      .media { aspect-ratio: 4/3; }
    }
  </style>

  <div class="wrap">
